# Rosalind 22, Reverse Complement Problem
from Bio.Seq import Seq

def reverse_complement(dna_string):
    dna_seq = Seq(dna_string)
    return str(dna_seq.reverse_complement())


dna_string = ""
result = reverse_complement(dna_string)
print(result)  
